import React from 'react';
import { connect } from 'react-redux';
import ContentItem from './ContentItem';
import PropTypes from 'prop-types';

class TableExpenses extends React.Component {
  render() {
    const { expenses } = this.props;
    return (
      <table className="table-new table">
        <tr className="table-cel table-row">
          <th className="table-cell th-cel">Descrição</th>
          <th className="table-cell th-cel">Tag</th>
          <th className="table-cell th-cel">Método de pagamento</th>
          <th className="table-cell th-cel">Valor</th>
          <th className="table-cell th-cel">Moeda</th>
          <th className="table-cell th-cel">Câmbio utilizado</th>
          <th className="table-cell th-cel">Valor convertido</th>
          <th className="table-cell th-cel">Moeda de conversão</th>
          <th className="table-cell th-cel">Excluir/Editar</th>
        </tr>
        {expenses
          .map((expense) => (
            <ContentItem
              key={expense.id}
              expense={expense}
            />
          ))}
      </table>
    )
  }
}

const mapStateToProps = (state) => ({
  expenses: state.wallet.expenses,
});

TableExpenses.propTypes = {
  expenses: PropTypes.arrayOf(PropTypes.object).isRequired,
};

export default connect(mapStateToProps)(TableExpenses);
